nd), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2770784","type":"CustomJS"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"2770404","type":"BoxAnnotation"},{"attributes":{"format":"0,0.[00]%"},"id":"2770468","type":"NumeralTickFormatter"},{"attributes":{"data":{},"selected":{"id":"2770537"},"selection_policy":{"id":"2770536"}},"id":"2770515","type":"ColumnDataSource"},{"attributes":{"below":[{"id":"2770626"}],"center":[{"id":"2770629"},{"id":"2770633"}],"height":90,"left":[{"id":"2770630"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"2770655"}],"sizing_mode":"stretch_width","title":{"id":"2770845"},"toolbar":{"id":"2770642"},"toolbar_location":null,"width":null,"x_range":{"id":"2770380"},"x_scale":{"id":"2770622"},"y_range":{"id":"2770620"},"y_scale":{"id":"2770624"}},"id":"2770618","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"2770638","type":"RedoTool"},{"attributes":{"source":{"id":"2770413"}},"id":"2770746","type":"CDSView"},{"attributes":{},"id":"2770753","type":"BasicTickFormatter"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"red"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"red"},"line_alpha":{"value":0.1},"line_color":{"value":"red"},"size":{"value":8},"x":{"value":1168},"y":{"value":0.0139314028040013}},"id":"277051
